import MealPreviwGrid from '../components/mealPreviwGrid';
import {FetchMealById} from '../../services/mealtService';

function Detail() {
    const [meals, setMeals] = useState([]);

	useEffect(() => {
		async function Data() {
			const meals = await FetchMealById('b');
			setMeals(meals);
		}
		Data();
	}, []);

	console.log(meals)
	return (
		<div className='page'>
			<MealPreviwGrid />
		</div>
	);
}

export default Detail;
